import React from 'react'
import CityTime from './CityTime'

export default function ClockDashboard() {

  const cities = [
    { name : 'New York', timezone: 'America/New_York' }, { name: 'London', timezone: 'Europe/London' }, { name: 'Tokyo', timezone: 'Asia/Tokyo' }, { name: 'Sydney', timezone: 'Australia/Sydney' }
  ];

  return (
    <div className='world-clock'>
      <h1> Clock Dashboard </h1>
      
      <ul className='cities'> 
        <CityTime /> </ul>
    </div>
  )
}
